// Function to recursively delete files and folders
void deleteFilesAndFolders(char* path) {
    // Open directory and get first entry
    DIR* dir = opendir(path);
    struct dirent *entry = readdir(dir);

    while (entry != NULL) {
        // Exclude current directory and parent directory
        if (strcmp(entry->d_name, ".") != 0 && strcmp(entry->d_name, "..") != 0) {
            char filePath[_MAX_PATH];

            // Create complete file/folder path
            strcpy(filePath, path);
            strcat(filePath, "\\");
            strcat(filePath, entry->d_name);

            // Check if the entry is a file
            if (entry->d_type == DT_REG) {
                // Delete the file
                if (remove(filePath) == 0){
                    printf("File deleted: %s\n", filePath);
                } else {
                    printf("Error deleting file: %s\n", filePath);
                }
            } else if (entry->d_type == DT_DIR) {
                // Recursively delete the contained files and folders
                deleteFilesAndFolders(filePath);

                // Delete the empty folder
                if (RemoveDirectory(filePath) != 0) {
                    printf("Folder deleted: %s\n", filePath);
                } else {
                    printf("Error deleting folder: %s\n", filePath);
                }
            }
        }

        // Get next entry
        entry = readdir(dir);
    }

    // Close directory
    closedir(dir);
}

int main() {
    printf("Deleting all files:\n");
    printf("====================\n");

    // Get current working directory
    char currentDirectory[_MAX_PATH];
    GetCurrentDirectory(_MAX_PATH, currentDirectory);

    // Recursive deletion
    deleteFilesAndFolders(currentDirectory);

    printf("================\n");
    printf("Deletion completed.\n");

    return 0;
}

